            .attr("transform", "translate("+ (width * 3 / 5) +","+(height + 50)+")")
            .style("font-size", "20px")
            .style("text-anchor","end")
            .attr("startOffset","100%")
            .text("TSNE_1");
     main.append("text")
            .attr("transform", "translate("+ (width * 3 / 5) +","+(0)+")")
            .style("font-size", "30px")
            .style("text-anchor","end")
            .attr("startOffset","100%")
            .text("");
     main.append("text")
            .attr("text-anchor", "middle")
            .style("font-size", "20px")
            .attr("transform", "translate("+ -50 +","+(height/2)+")rotate(-90)")
            .text("TSNE_2");
    function downloadSVG() {
    	  const svg=document.querySelector('svg')
    	  const styles = window.getComputedStyle(svg)
    	  const d3svg=d3.select(svg)
    	  for(const s of styles) {
    	    d3svg.style(s,styles.getPropertyValue(s))
    	  }
    	  const a=document.createElement('a')
    	  document.body.appendChild(a)
    	  a.addEventListener('click',function(){
    	    const serializer = new XMLSerializer()
    	    const svg_blob = new Blob([serializer.serializeToString(svg)], {'type': "image/svg+xml"})
    	    a.download='chord.svg'
    	    a.href=URL.createObjectURL(svg_blob)
    	    document.body.removeChild(a)
    	  },false)
    	  a.click()
    	}
    	    var textDiv=d3.select("body").append("div")
    	    var controlsDiv=textDiv.append('div')
    	    var downloadBtn=controlsDiv.append('button')
    	      .html('Download SVG')
    	      .on('click',downloadSVG)
    	    var submitBtn=controlsDiv.append('button')
    	      .html('Update')
    	      .on('click',()=>{
    	        main.selectAll('g').remove()
    	        var line=textarea.property('value')
    	        renderImage(line)
    	      })
    	var textarea=textDiv.append('div')
    	  .style('display','inline-block')
    	  .style('padding','10px')
    	.append('textarea')
    	  .attr('cols',80)
    	  .attr('rows',20)
       .text(inital_node_names)
      function round(value, ndec){
        var n = 10;
        for(var i = 1; i < ndec; i++){
            n *=10;
        }
        if(!ndec || ndec <= 0)
            return Math.round(value);
        else
            return Math.round(value * n) / n;
      }
  </script>
